import { Breadcrumbs } from "govuk-react";

function viewAppointment() {
    return(
        <div>
      <Breadcrumbs>
  <Breadcrumbs.Link href="">
    Section
  </Breadcrumbs.Link>
  <Breadcrumbs.Link to="">
    Sub-section
  </Breadcrumbs.Link>
  Current page
</Breadcrumbs>

        </div>
    );

}
export default viewAppointment;
